<p>The 33-year-old angled the camera from above, showing off a much plumper pout, defined cheekbones, and an enviable line-free visage.</p>

<p>Like a new woman! Former Bachelor star Emma Roche continued to show off her dramatic transformation, including a much fuller pout and a line-free visage,  in her latest Instagram selfie on Tuesday (pictured) </p>

<p>Emma's radiant skin was enhanced by a flawless makeup palette, consisting of groomed brows, false lashes and a sweep of blush along her cheekbones.</p>

